import {useParams, Link} from "react-router-dom";

export default function GameField({gameState, functions: {drawFigure}}){

  let params = useParams();
  let gameId = params.gameId;
  console.log(gameState)
  return (
    <>
      <Link to = "/">Main Screen</Link>
      <h4>Welcome from game field: {gameId}</h4>
      <div id = "gameBoardContainer">
        <div id = "gameBoard">
          {gameState.map((boardCell, i) => {
            return (
              <div key = {i} onClick = {() => drawFigure(i)}>
                {boardCell !== "" ? boardCell : ""}
              </div>
            )
          })}
        </div>
      </div>
    </>
  )
}
